def _cython_agg_blocks(
    self, how: str, alt=None, numeric_only: bool = True, min_count: int = -1
) -> "Tuple[List[Block], Index]":
    data: BlockManager = self._get_data_to_aggregate()

    if numeric_only:
        data = data.get_numeric_data(copy=False)

    agg_blocks: List[Block] = []
    new_items: List[np.ndarray] = []

    for block in data.blocks:
        result, coerce_numeric = maybe_convert_objects(how, block.values, min_count)

        # Handle nullable integer dtype
        if isinstance(block.dtype, pd.IntDtype):
            if how == "mean" or how == "var":
                # Replace pd.NA with np.nan for calculating mean or var
                result[np.isnan(result)] = pd.NA
            elif how == "median":
                # Replace pd.NA with np.nan for calculating median
                result = result.astype(np.float)
                result[np.isnan(result)] = pd.NA

        result, _ = maybe_downcast_to_dtype(result, numeric_only, coerce_numeric)

        agg_blocks.append(block.make_block(result))

    if not agg_blocks:
        raise DataError("No numeric types to aggregate")

    return agg_blocks, data.items
